import React from 'react';
import './Champion.css'; 

function Champion({ key, team, className, startingPosition, currentPosition, image, type, starLevel, headliner, items, onDragStart, onDragEnd, onDragOver, onDrop }) {
  return (
    <div
      className={`champion ${className}`}
      onDragStart={(e) => onDragStart(e, team, key)}
      onDragEnd={onDragEnd}
      onDragOver={(e) => onDragOver(e)}
      onDrop={(e) => onDrop(e, { left: currentPosition.left, top: currentPosition.top })}
      style={{ 
        left: currentPosition.left + 'px', 
        top: currentPosition.top + 'px', 
        backgroundImage: `url(${image})`,
        backgroundSize: 'cover', 
      }}
    ></div>
  );
}

export default Champion;
